Koyva River (Russian: Койва) is a river in Perm Krai in Russia, a right tributary of the Chusovaya River (Kama's basin). The river is 180 kilometres (110 mi) long, and its drainage basin covers 2,300 square kilometres (890 sq mi). It starts on the western slope of the Ural Mountains, on the slopes of Mount Bolshaya Khmelikha. Its mouth is near the settlement Ust-Koyva, 66 kilometres (41 mi) from the mouth of the Chusovaya River. It is a mountain river with many rapids and shoals. It was along the Koyva River that the first ever diamonds were found in 1829 in Russia. There are urban-type settlement Tyoplaya Gora situated by the river. Main tributaries: 
* Left: Tiskos, Tyrym, Olkhovka; 
* Right: Biser, Kusya.

Kosva (Russian: Ко́сьва) is a river in Perm Krai and Sverdlovsk Oblast, Russia, a left tributary of the Kama River. It is 283 kilometres (176 mi) long, with a drainage basin of 6,300 square kilometres (2,400 sq mi). The river starts in the western portion of Sverdlovsk Oblast at the confluence of Bolshaya Kosva (Large Kosva), flowing from the Pravdinsky Rock, and Malaya Kosva (Small Kosva), flowing from the southern slope of the Kosvinsky Rock. It flows towards the west, and ends up in a bay of the Kama Reservoir. The Kosva is a mountain river with many waterfalls and rapids, among them the 6-kilometre (4 mi) long Tulymsky Falls. In the middle parts of the river lies the Shirokovskaya hydroelectric power plant with Shirokovskoe Reservoir. The town of Gubakha is situated by the Kosva. Main tributaries: 
* Left: Kyrya;  
* Right: Typyl, Tylai, Nyar, Nyur, Pozhva
